import React from 'react';
import Sidebar from '../Dashboard/Sidebar/Sidebar';

const AddDoctor = () => {
    return (
        <div className="row d-flex justify-content-center">
            <div className="col-md-6 col-sm-6">
                <Sidebar/>

            </div>
            <div  className="col-md-6 col-sm-6">
                <h1> Hi Ima the doctor</h1>
            </div>
        </div>
    );
};

export default AddDoctor;
